import React from 'react';
import { Link } from 'react-router-dom';

const PracticalWorks = () => {
  return (
    <div>
      <h2>Практичні роботи</h2>
      <ul>
        <li><Link to="/practical-work-1">Практична робота 1</Link></li>
        <li><Link to="/practical-work-2">Практична робота 2</Link></li>
        <li><Link to="/practical-work-3">Практична робота 3</Link></li>
        <li><Link to="/practical-work-4">Практична робота 4</Link></li>
        <li><Link to="/practical-work-5">Практична робота 5</Link></li>
      </ul>
    </div>
  );
};

export default PracticalWorks;
